  return (
    <React.Fragment>
      <div className="container">
        <video autoPlay loop muted>
          <source src={Giphy} type="video/gif"/>
        </video>
        <CurrentLocation />
      </div>
      <div className="footer-info">
       <a>
         Developed for Axonista by Palash
       </a>
      </div>
    </React.Fragment>
  );
}

export default App;
